设置一个新的头结点，遍历旧链表把每一个结点按顺序前插到新的链表中完成反转；使用可选项绑定来判空，首先临时保存当前结点的下一个结点， 将当前结点前插到新链表中时，next指向发生变化，所以必须先保存next；接着使current后移完成遍历，新头结点前移等待下一次前插；最终 新头结点为新链表的头结点 class LinkNode<T> { var data: T var next: LinkNode? init(_ data: T, _ next: LinkNode? = nil) { self.data = data self.next = next }
} func reverse<T>(_ head: LinkNode<T>?) -> LinkNode<T>? { var current = head var newHead: LinkNode<T>? = nil while let cur = current { let temp = cur.next cur.next = newHead current = temp newHead = cur } return newHead
}

